        self.assert_eval_cmp('"":=["x"]', '""')
        self.assert_eval_cmp('"x":=["y" 0]', '"y"')
        self.assert_eval_cmp('"abc":=["x"]', '"abc"')
        self.assert_eval_cmp('"abc":=["_" 0]', '"_bc"')
        self.assert_eval_cmp('"abcabc":=["__" 0 4]', '"__ca__"')
