        self.assert_eval_cmp('[6]:_"abcdef"', '["abcdef" ""]')
        self.assert_eval_cmp('[1 3 5]:_"abcdef"', '["a" "bc" "de" "f"]')
        self.assert_eval_cmp('(!7):_"abcdef"', '["" "a" "b" "c" "d" "e" "f" ""]')

