        self.assert_eval_test('t("f3(;2;)@[4 5]" ; f3(;2;)@[4 5] ; -6)', klong=klong )
        self.assert_eval_test('t("f3(;;3)@[4 5]" ; f3(;;3)@[4 5] ; -11)', klong=klong )

